from typing import List
from collections import defaultdict  
class Solution:
    def groupStrings(self, words: List[str]) -> List[int]:
    # union find
        def bit_state(word:str)->int :
            # 把每个单词变成编码
            ans=0
            for w in word:
                ans+=2**(ord(w)-ord('a'))
            return ans
        
        def find_top_index(index):
            while equal_index[index]!=index:
                index=equal_index[index]
            return index 
        def union(index_i,index_k):
            x=find_top_index(index_i)
            y=find_top_index(index_k)
            if x<y:
                equal_index[y]=x 
            else:
                equal_index[x]=y
        state_to_word_mapping=defaultdict(int) #  找到不同的state 对应的
        # 每个word 都可以表示成一种状态，a,b,c,d,e...z 表示可以成为一个二进制，有就表示为1
        # word[i] 与 word[j] connected的情况，可能为， word[i]==word[j] word[i]减去某个标志位等于word[j]，
        # 或者word[j] 减去一个标志位等于word[i]，
        # 或者word[i] ,word[j] 同时减去一个标志位
        equal_index={}
        for index,word in enumerate(words):
            equal_index[index]=index
            word_bit_state=bit_state(word)
            if word_bit_state in state_to_word_mapping:
                index_k=state_to_word_mapping[word_bit_state]
                # 记录 index_k 和 index 等价。
                if find_top_index(index_k)!=find_top_index(index):
                    union(index,index_k) # 认为等价，保证index和index_k最终指向同一个。
            else:
                state_to_word_mapping[word_bit_state]=index
        #for word in words:
            for ch in word:
                change_bit_state=word_bit_state-2**(ord(ch)-ord('a'))
                if change_bit_state in state_to_word_mapping:
                    index_k=state_to_word_mapping[change_bit_state]
                    if find_top_index(index) != find_top_index(index_k):
                        union(index,index_k)
                else:
                    state_to_word_mapping[change_bit_state]=equal_index[index]  
        # 计算群,找到群，equal_index 最终会找到最小的群的。
        group_index_counter=defaultdict(lambda:   0  )
        for index in range(len(words)):
            top_index=find_top_index(index)
            group_index_counter[top_index]+=1 
        max_group=0
        for index,cnt in group_index_counter.items():
            max_group=max(max_group,cnt)
        return [len(group_index_counter),max_group]
        
